column8:
【プロとの共同開発により、プロが推奨する製品として生まれました】<br>実際に、ボディのキズや油膜も取れて、金属の表面も磨ける。<br>多用途に使えるので、コレ1本あれば非常に便利！<br><br>●ボディの小キズ、すりキズ消し<br>●ヘッドライトカバーの黄ばみ、すりキズ消し<br>●頑固な油膜除去<br>●プラスチックのすりキズ消し<br>●金属の表面光沢磨き<br>●全塗装色対応<br><br><br>【セット内容】<br>万能クリーナー 130g<br>専用スポンジ<br><br><br>【仕様】<br>用途：自動車塗装面、ガラス面、金属面の研磨用<br>成分：アルミナ、有機溶剤、増粘剤、非イオン界面活性剤<br>内容量：130g<br>形式・液性：液体・中性<br><br>メーカー：アウグ<br>品番：PR-007<style type="text/css">
