自動車メーカー純正品の開発を生かし、機能を追求した一品です。<br><br>●ボディに付いている小キズ・擦りキズ・引っかきキズ及び<br>頑固な水アカ・しつこい汚れを除去し、ツヤのある光沢を与えます。<br><br>※引っかきキズは、キズの状況(深い、浅い)並びに<br>塗装の状態によって修復具合が変わります。<br><br><br>【仕様】<br><br>名称：自動車塗装面研磨ツヤ出し剤<br>用途：自動車塗装面の洗浄、キズ取り、ツヤ出し<br>形式・液性：液体・中性<br>内容量：100g<br><br>メーカー：アウグ<br>品番：PR-001<style type="text/css">
