●鍵キズ・こすりキズを消す！<br><br>●小さな飛び石痕を平滑な面にする！<br><br>●ボディの汚れ・頑固な水アカ・雨ジミを除去！<br><br>●ペイント補修後の仕上げに！<br><br><br>【仕様】<br><br>名称：自動車用塗装研磨剤<br>用途：塗装面のキズ消し及びつや出し用<br>形式・液性：液体・中性<br>内容量：130g<br><br>メーカー：アウグ<br>品番：AD-20<style type="text/css">
